		2,
		'Orca',
		'https://upload.wikimedia.org/wikipedia/commons/3/37/Killerwhales_jumping.jpg',
		'The killer whale or orca (Orcinus orca) is a toothed whale belonging to the oceanic dolphin family, of which it is the largest member. It is recognizable by its black-and-white patterned body. A cosmopolitan species, killer whales can be found in all of the world''s oceans in a variety of marine environments, from Arctic and Antarctic regions to tropical seas; they are absent only from the Baltic and Black seas, and some areas of the Arctic Ocean.',
		'Data Deficient'
	),
	(
		4,
		'Blue whale',
		'https://upload.wikimedia.org/wikipedia/commons/1/1c/Anim1754_-_Flickr_-_NOAA_Photo_Library.jpg',
		'The blue whale (Balaenoptera musculus) is a marine mammal belonging to the baleen whale parvorder Mysticeti. Reaching a maximum confirmed length of 29.9 metres (98 ft) and weighing up to 199 tonnes (196 long tons; 219 short tons), it is the largest animal known to have ever existed. The blue whale''s long and slender body can be various shades of greyish-blue dorsally and somewhat lighter underneath.',
		'Endangered'
	),
	(
		1,
		'Humpback whale',
		'https://upload.wikimedia.org/wikipedia/commons/6/61/Humpback_Whale_underwater_shot.jpg',
		'The humpback whale (Megaptera novaeangliae) is a species of baleen whale. It is one of the larger rorqual species, with adults ranging in length from 12–16 m (39–52 ft) and weighing around 25–30 t (28–33 short tons). The humpback has a distinctive body shape, with long pectoral fins and a knobbly head. It is known for breaching and other distinctive surface behaviors, making it popular with whale watchers. Males produce a complex song lasting 10 to 20 minutes, which they repeat for hours at a time. All the males in a group will produce the same song, which is different each season. Its purpose is not clear, though it may help induce estrus in females.',
		'Least Concern'
	),
	(
		3,
		'Finback whale',
		'https://upload.wikimedia.org/wikipedia/commons/thumb/c/ce/Finhval_%281%29.jpg/1920px-Finhval_%281%29.jpg',
		'The fin whale (Balaenoptera physalus), also known as finback whale or common rorqual and formerly known as herring whale or razorback whale, is a cetacean belonging to the parvorder of baleen whales. It is the second-longest species of cetacean on Earth after the blue whale. The largest reportedly grow to 27.3 m (89.6 ft) long with a maximum confirmed length of 25.9 m (85 ft), a maximum recorded weight of nearly 74 tonnes (73 long tons; 82 short tons), and a maximum estimated weight of around 114 tonnes (112 long tons; 126 short tons). American naturalist Roy Chapman Andrews called the fin whale "the greyhound of the sea ... for its beautiful, slender body is built like a racing yacht and the animal can surpass the speed of the fastest ocean steamship."',
		'Vulnerable'
	),
	(
		5,
		'Grey whale',
		'https://upload.wikimedia.org/wikipedia/commons/thumb/0/00/Ballena_gris_adulta_con_su_ballenato.jpg/1920px-Ballena_gris_adulta_con_su_ballenato.jpg',
		'The gray whale (Eschrichtius robustus), also known as the grey whale, gray back whale, Pacific gray whale, or California gray whale, is a baleen whale that migrates between feeding and breeding grounds yearly. It reaches a length of 14.9 meters (49 ft), a weight of up to 41 tonnes (90,000 lb) and lives between 55 and 70 years, although one female was estimated to be 75–80 years of age. The common name of the whale comes from the gray patches and white mottling on its dark skin. Gray whales were once called devil fish because of their fighting behavior when hunted. The gray whale is the sole living species in the genus Eschrichtius. It was formerly thought to be the sole living genus in the family Eschrichtiidae, but more recent evidence classifies members of that family in the family Balaenopteridae. This mammal is descended from filter-feeding whales that appeared during the Neogene.',
		'Least Concern'
	),
	(
		6,
		'Sperm whale',
		'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b1/Mother_and_baby_sperm_whale.jpg/1920px-Mother_and_baby_sperm_whale.jpg',
		'The sperm whale or cachalot (Physeter macrocephalus) is the largest of the toothed whales and the largest toothed predator. It is the only living member of the genus Physeter and one of three extant species in the sperm whale family, along with the pygmy sperm whale and dwarf sperm whale of the genus Kogia.',
		'Vulnerable'
	),
	(
		7,
		'Narwhal',
		'https://files.worldwildlife.org/wwfcmsprod/images/HERO_Narwhals_Canada/magazine_hero/2l0u305168_Medium_WW248926.jpg',
		'The narwhal or narwhale (Monodon monoceros) is a medium-sized toothed whale that possesses a large "tusk" from a protruding canine tooth. It lives year-round in the Arctic waters around Greenland, Canada, and Russia. It is one of two living species of whale in the family Monodontidae, along with the beluga whale. The narwhal males are distinguished by a long, straight, helical tusk, which is an elongated upper left canine. The narwhal was one of many species described by Carl Linnaeus in his publication Systema Naturae in 1758.',
		'Least Concern'
	),
	(
		8,
		'Bowhead whale',
		'https://upload.wikimedia.org/wikipedia/commons/c/c9/Bowheads42.jpg',
		'The bowhead whale (Balaena mysticetus) is a species of baleen whale belonging to the family Balaenidae and the only living representative of the genus Balaena. They are the only baleen whale endemic to the Arctic and subarctic waters, and are named after their characteristic massive triangular skull, which they use to break through Arctic ice. Other common names of the species are the Greenland right whale or Arctic whale. American whalemen called them the steeple-top, polar whale, or Russia or Russian whale.',
		'Least Concern'
	),
	(
		9,
		'Beluga whale',
		'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e8/Oceanogr%C3%A0fic_29102004.jpg/1920px-Oceanogr%C3%A0fic_29102004.jpg',
		'The beluga whale (/bɪˈluːɡə/) (Delphinapterus leucas) is an Arctic and sub-Arctic cetacean. It is one of two members of the family Monodontidae, along with the narwhal, and the only member of the genus Delphinapterus. It is also known as the white whale, as it is the only cetacean to regularly occur with this colour; the sea canary, due to its high-pitched calls; and the melonhead, though that more commonly refers to the melon-headed whale, which is an oceanic dolphin.',
		'Least Concern'
	),
	(
		11,
		'Minke whale',
		'https://upload.wikimedia.org/wikipedia/commons/d/d9/Minke_Whale_%28NOAA%29.jpg',
		'The minke whale /ˈmɪnki/, or lesser rorqual, is a species complex of baleen whale. The name is a partial translation of Norwegian minkehval, possibly after a Norwegian whaler named Meincke, who mistook a northern minke whale for a blue whale.',
		'Least Concern'
	),
	(
		12,
		'Pilot whale',
		'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e2/Pilot_whale.jpg/1920px-Pilot_whale.jpg',
		'Pilot whales are cetaceans belonging to the genus Globicephala. The two extant species are the long-finned pilot whale (G. melas) and the short-finned pilot whale (G. macrorhynchus). The two are not readily distinguishable at sea, and analysis of the skulls is the best way to distinguish between the species. Between the two species, they range nearly worldwide, with long-finned pilot whales living in colder waters and short-finned pilot whales living in tropical and subtropical waters. Pilot whales are among the largest of the oceanic dolphins, exceeded in size only by the orca. They and other large members of the dolphin family are also known as blackfish.',
		'Least Concern'
	),
	(
		10,
		'Southern right whale',
		'https://upload.wikimedia.org/wikipedia/commons/c/c2/Southern_right_whale6.jpg',
		'The southern right whale (Eubalaena australis) is a baleen whale, one of three species classified as right whales belonging to the genus Eubalaena. Southern right whales inhabit oceans south of the Equator, between the latitudes of 20° and 60° south.',
		'Least Concern'
	)
;

